import com.eviware.soapui.support.GroovyUtils

// Declaring variables and importing properties

def emailID = context.expand('${#TestCase#emailID}')
log.info("GP = " + emailID)

// import the Request property of AddRequest Step

def addReqXml = context.expand('${CreateCust#Request}')

log.info("Request xml of Add "  + addReqXml)

// Creating a XML holder

def gUtil = new GroovyUtils(context)
def Xmlhol = gUtil.getXmlHolder(addReqXml)

// changing value of element intA and IntB
Xmlhol.namespaces['ns1'] = "http://soap.upskills.in/soap/default?services=customerCustomerRepositoryV1">
Xmlhol.setNodeValue("//*:email",emailID)


// set the modified XML value to the AddRequest#Request Property
def modifiedXmlAsString = Xmlhol.getXml()
log.info(modifiedXmlAsString)

testRunner.testCase.getTestStepByName("CreateCust").setPropertyValue("Request",modifiedXmlAsString)

//Get current testsuite and testcase names
def casename = context.getTestCase().name
def Suitename = context.getTestCase().getTestSuite().name 


// Run the AddRequest Step
// This syntax can run any step, from any test case, from any test Suite.

testRunner.testCase.testSuite.project.testSuites[Suitename].testCases[casename].testSteps["CreateCust"].run(testRunner,context)

// Get the response property from AddRequest
def addResXml = context.expand('${CreateCust#Response}')
log.info(addResXml)
// create an xml holder to get ADD result value
def Xmlhol1 = gUtil.getXmlHolder(addResXml)
//Xmlhol1.namespaces['ns1'] = "http://soap.upskills.in/soap/default?services=customerCustomerRepositoryV1">
def result1 = Xmlhol1.getNodeValue("//*:defaultShipping")
//log.info(result1)
//testRunner.testCase.setPropertyValue("Result_Addition",result)


def subReqXml = context.expand('${ViewCustAddByID#Request}')
def Xmlhol2 = gUtil.getXmlHolder(subReqXml)
Xmlhol2.namespaces['ns1'] = "http://soap.upskills.in/soap/default?services=customerCustomerRepositoryV1">
Xmlhol2.setNodeValue("//*:addressId",result1)



def modifiedXmlAsString1 = Xmlhol2.getXml()


testRunner.testCase.getTestStepByName("ViewCustAddByID").setPropertyValue("Request",modifiedXmlAsString1)
testRunner.testCase.testSuite.project.testSuites[Suitename].testCases[casename].testSteps["ViewCustAddByID"].run(testRunner,context)

// Get the response property from AddRequest
def subResXml = context.expand('${ViewCustAddByID#Response}')

